import React from "react";

function Footer() {
    return (
        <div className="m-10 text-sm text-center text-gray-500">
            <p>Employee pictures provided by <a href="/" className="font-bold text-gray-600 hover:text-yellow-500">GitHub</a></p>
            <p>Built by <a href="/" className="font-bold text-gray-600 hover:text-yellow-500">Cynthia Mojica</a></p>
        </div>
    )
}

export default Footer;
